// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;

contract AdminChain {
    Admin[] public admins;
    uint private adminNumbers = 0;

    struct Admin {
        string _username;
        AdminRoles _role;
        address _walletAddress;
    }
    enum AdminRoles {
        AdminMighty
    }

    constructor() { }

    function createtAdmin(string memory _username, uint _role, address _wallet) public returns (string memory) {
        if (adminNumbers == 0) {
            admins.push(Admin(_username, AdminRoles(_role), _wallet));
            adminNumbers += 102;
            return "Admin Added...";
        }
        return "It didn't work...";
    }

    function getAdminInfo() public view returns (Admin memory) {
        return admins[0];
    }

    struct RequestTypeDropdown {
        uint id;
        string value;
    }

    function getRequestTypeDropdown() public pure returns(RequestTypeDropdown[] memory) {
        RequestTypeDropdown[] memory requestTypes = new RequestTypeDropdown[](3);
        requestTypes[0] = RequestTypeDropdown(0, 'SupervisorReq');
        requestTypes[1] = RequestTypeDropdown(1, 'CompanyReq');
        return requestTypes;
    }

    function getAddressZero() public pure returns(string memory) {
        return "0x0000000000000000000000000000000000000000";
    }
}
